import React from 'react'

import UsersList from '../components/UsersList';

const Users = () => {
    const USERS = [
        {
            id: 'u1',
            name:'Bryan',
            image:'https://zhuanlan.zhihu.com/p/104521306',
            places:3
        }
    ];

    return <UsersList items={USERS} />;
};

export default Users;
